sys_variable_value.value:
(function execute(inputs, outputs) {	
  outputs.team_id = gs.getProperty('x_citin_s2p_spoke.team_id');
  var categories_array = inputs.solicitations_category_ids.split(",");
  var subcategories_array = inputs.solicitations_subcategory_ids.split(",");
  outputs.payload = {
    "project": {
        "name": inputs.name,
        "procurement_official_id": inputs.procurement_official_id,
        "solicitations_type_id": inputs.solicitations_type_id,
        "solicitations_purchase_class_id": inputs.solicitations_purchase_class_id,
        "solicitations_category_ids": categories_array,
        "solicitations_subcategory_ids": subcategories_array,
      	"solicitations_vehicle_id": inputs.lpa_id
    }
  }
})(inputs, outputs);

